import { Bar } from "react-chartjs-2";

import "./IncExpChart.css";

const IncExpChart = () => {
  return (
    <div className="chart">
      <Bar>
        data={{ labels: ["Red", "Green"] }}
        width={300}
        height={200}
        color="aqua"
      </Bar>
    </div>
  );
};
export default IncExpChart;
